import logo from './logo.svg';
import './App.css';
import PreLoader from './component/PreLoader';
import './style.css';
//import index from './index.html'
import 'boxicons';
<script src="https://unpkg.com/boxicons@2.1.4/dist/boxicons.js"></script>
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
//import { faFacebook } from '@fortawesome/free-brands-svg-icons';



function App() {
  return (

    <>


    <header class = "header">

      <a href="#" class="logo">Jones.</a>

      <nav class = "navbar">
          <a href="#" class="active">Home </a>
          <a href="#">About </a>
          <a href="#">Services </a>
          <a href="#">Portfolios </a>
          <a href="#">Contact</a>


      </nav>
    </header>

    <section class="home">
      <div class="home-content">
        <h1>Hi I am Joymanu Musabayana</h1>
        <h3>FullStack Developer</h3>
          <p>Line 23:11:  The href attribute requires a valid value to be accessible. Provide a valid, navigable address as the href value. If you cannot provide a valid href, but still need the element to resemble a link, use a button and change it with appropriate styles. Learn more: https://github.com/jsx-eslint/eslint-
          </p>
          <div class="btn-box">
            <a href="#">Hire Me</a>
            <a href="#">Let's Talk</a>
          </div>

          <div class="home-sci">
            <box-icon name='facebook' type='logo'></box-icon>

            <a href="#"><li><box-icon name='facebook' type='logo' color='#00abf0' ></box-icon></li></a>     
            <a href="#"><box-icon type='logo' name='twitter' color='#00abf0'></box-icon></a>
            <a href="#"><box-icon type='logo' name='linkedin' color='#00abf0'></box-icon></a>


      </div>

      </div>
    </section>


    </> 
     );
}

export default App;
